import{_ as p}from"./plugin-vue_export-helper-c27b6911.js";import{o as _,c as e,e as t}from"./app-60a1dd49.js";const o={},c=t("<p>《三命通会》卷 九·六癸日甲寅时断</p><p>六癸日生时甲寅，刃复官禄减精神；</p><p>柱中无有庚申字，刑合财官是贵人。</p><p>癸日甲寅时，刑合财官，癸以丙为财，戊为官，寅刑出巳中丙戊为财官，若柱无官煞及刑冲破害损格，贵；有庚申戊己字，无制伏，不贵。</p><p>癸丑日甲寅时，本贵，丑中有辛金，减其分数。</p><p>纯水年月，官至一品。</p><p>秋生印绶，亦贵。</p><p>辰月，行东运，贫下。</p><p>纯申破寅，凶。</p><p>癸卯日甲寅时，亥卯未月，至贵。</p><p>寅卯年月，刑合格，侯伯。</p><p>寅亥，四品。</p><p>寅月，西运，金紫。</p><p>丑戌辰巳，亦贵。</p><p>癸巳日甲寅时，平，通身旺月，大贵。</p><p>忌戊己庚申字，岁运同。</p><p>癸未日甲寅时，主秀实，中年贵显。</p><p>若生己未己巳年月，武贵。</p><p>癸酉日甲寅时，金神格。</p><p>寅午戌月，结火局，贵显特达，官至二三品。</p><p>忌丑年，不贵。</p><p>巳未亥子年月，富寿。</p><p>辰丑，干透甲丁者，凶。</p><p>癸亥日甲寅时，子丑未申月，进士，运行金水，风宪。</p><p>卯戌年月，地支六合，贵。</p><p>甲寅癸日戊丙开，少年未遇且沈埋；若还四柱无冲破，平步登云到省台。</p><p>癸日寅时克应，支干相合光荣，若无壬己戊庚申，必然财禄丰润。</p><p>运至皇州显达，文章虎榜标名，但逢一字稍空冲，克子伤食剥俸。</p>",28),r=[c];function s(n,a){return _(),e("div",null,r)}const f=p(o,[["render",s],["__file","277卷 九·六癸日甲寅时断.html.vue"]]);export{f as default};
